// â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•

config({ stopLoss: 1.2, takeProfit: 2.0 });

// â”€â”€â”€ Indicadores â”€â”€â”€
const r = rsi(14);
const emaFast = ema(8);
const emaMid = ema(21);
const emaSlow = ema(50);
const m = macd(12, 26, 9);
const bands = bb(20, 2);
