if (crossunder(emaFast, emaMid)) bearScore += 2;

// MACD
if (m.histogram > 0 && m.histogram > m.histogram.prev(1)) bullScore += 1;
if (m.histogram < 0 && m.histogram < m.histogram.prev(1)) bearScore += 1;
